import React,{ useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const Register = () => {
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPasswod] = useState('');
    const [confPassword, setConfPassword] = useState('');
    const [msg, setMsg] = useState('');
    const history = useNavigate();

    const Register = async(e) =>{
        e.preventDefault();wekdwedwed
        try{
            await axios.post('http://localhost:5000/user', {
                name: name,
                email: email,
                password: password,
                confPassword: confPassword
            });
            history.push("/");
        }catch(error){
            if (error.response){
                setMsg(error.response.data.msg);
            }
        }
    }

  return (
    <section className="hero has-ackground-grey-light is-fullheight is-fullwidth">
        <div className="hero-body">
            <div className="container">
                <div className="columns is-centered">
                    <div className="column is-4-desktop">
                        <p className="has-text-centered">{msg}</p>
                        <form onSubmit={Register} className="box">
                            <div className="field mt-5">
                                <label className="label">Name</label>
                                <div className="controls">
                                    <input type="text" className="input" placeholder="Name" value={name} onChange={(e) => setName(e.target.value)} />
                                </div>
                            </div>
                            <div className="field mt-5">
                                <label className="label">Email</label>
                                <div className="controls">
                                    <input type="text" className="input" placeholder="Email" value={email} onChange={(e) => setEmail(e.target.value)}/>
                                </div>
                            </div>
                            <div className="field mt-5">
                                <label className="label">Password</label>
                                <div className="controls">
                                    <input type="password" className="input" placeholder="*****" value={password} onChange={(e) => setPasswod(e.target.value)}/> 
                                </div>
                            </div> 
                            <div className="field mt-5">
                                <label className="label">Confirm Password</label>
                                <div className="controls">
                                    <input type="password" className="input" placeholder="*****" value={confPassword} onChange={(e) => setConfPassword(e.target.value)}/> 
                                </div>
                            </div>      
                            <div className="field mt-5">
                                <button className="button is-success is-fullwidth">Register</button>
                            </div>              
                        </form>
                    </div>
                </div>
            </div>
        </div>
    </section>
  )
}

export default Register
